style.css:
@-moz-document domain("lichess.org")
{
  body.dark
  {
    background: #333;
    color: Chocolate;
  }

  body.user_link
  {
    color: red;
  }

  body.dark a, body.dark a:visited, body.dark #powerTip > .actions a, body.dark group.radio label, body.dark .button, body.dark .lichess_ground .replay glyph
  {
    color: #784D4D;
  }

  #top a
  {
    color: chocolate;
  }

  #top #topmenu a
  {
    color: chocolate;
  }
}
